function goToParty() {
    if (document.getElementById("inPart").value!="" && document.getElementById("inPart").value!=null) {
        window.location.href = '/party/'+document.getElementById("inPart").value;
    }
    return false;
}

function goToProfil() {
    if (document.getElementById("inProf").value!="" && document.getElementById("inProf").value!=null) {
        window.location.href = '/profil/'+document.getElementById("inProf").value;
    }
    return false;
}
